			},
			["frameStrata"] = 1,
			["anchorFrameType"] = "SCREEN",
			["actions"] = {
				["start"] = {
					["do_custom"] = true,
					["custom"] = "aura_env.sortAndOffset()",
				},
				["finish"] = {
					["do_custom"] = true,
					["custom"] = "if aura_env.state.name ==\"野生小鬼\" then\n    if aura_env.impNumber >=1 then\n        aura_env.impNumber = aura_env.impNumber - 1\n    end\n    WeakAuras.ScanEvents(\"IMP_NUMBER_UPDATE\", aura_env.impNumber)\n    \n    if aura_env.impEnergy - aura_env.state.stacks >= 0 then\n        aura_env.impEnergy = aura_env.impEnergy - aura_env.state.stacks\n    else\n        aura_env.impEnergy = 0\n    end\n    if aura_env.tyrantExist == false then\n        WeakAuras.ScanEvents(\"IMP_ENERGY_UPDATE\", aura_env.impEnergy)    \n    end\n    \n    \nend\n\nif aura_env.state.name == \"恶魔暴君cd\" then\n    WeakAuras.ScanEvents(\"TYRANT_READY\", 1)\nend\n\n\naura_env.sortAndOffset()\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n\n",
				},
				["init"] = {
					["do_custom"] = true,
					["custom"] = "-----------------------------------------------\n-----------WA function reloading-----------\n-----------------------------------------------\nlocal aura_env = aura_env\nWeakAuras.GetRegion= function(id, cloneId) \n    if id == aura_env.id and WeakAuras.triggerState[aura_env.id] then\n        local allstates = WeakAuras.triggerState[aura_env.id][1]\n        if allstates and allstates[cloneId] and not allstates[cloneId].show then \n            --- print(\"save the world!\")\n            return false \n        end\n    end\n    \n    if(cloneId and cloneId ~= \"\") then\n        return WeakAuras.EnsureClone(id, cloneId);\n    end\n    return WeakAuras.regions[id] and WeakAuras.regions[id].region; \nend --reload the WA function GetRegion. Since there is a bug misusing the function when the bar frame's attribute show=false. So doing nothing when allstates[cloneId].show == false.\n\n------------------------------------------------\n--------Different Language Support---------\n------------------------------------------------\n\n\n------------------------------------------------\n--------Temp & Constant Variables---------\n------------------------------------------------\naura_env.tyrantDuration = 15\naura_env.dreadstalkersDuration = 12\naura_env.portalDemoDuration = 15\naura_env.vilefiendDuration = 15\naura_env.tyrantExtendingTime = 15\naura_env.felguardDuration = 16 -- blz claimed to be 15 sec but it should exist a little bit more than 15 sec.\naura_env.impDuration = 22\naura_env.impTotalStacks = 5\n\naura_env.implode_table = {}\naura_env.lastDreadstalkerTime = 0\naura_env.lastEyeTime = 0\naura_env.tyrantExist=false\naura_env.tyrantStartTime = 0\naura_env.impNumber = 0\naura_env.impEnergy = 0\n\n------------------------------------------------\n----------Bar Position and Layout------------\n------------------------------------------------\nlocal spacing = 3 \nlocal perRow = 1\n\nspacing = aura_env.config.spacing or 5;\nperRow = 1\nhorzontal_growth = 'RIGHT'\nif aura_env.config.verticalGrowth == 1 then\n    vertical_growth = \"DOWNWARD\"\nelse\n    vertical_growth = \"UPWARD\"\nend\nsort_direction = 'DESC'; \n\n\nlocal aura_env = aura_env\naura_env.sortAndOffset = function()\n    local baseX = WeakAuras.regions[aura_env.id].region.xOffset\n    local baseY = WeakAuras.regions[aura_env.id].region.yOffset\n    local count = 0\n    local t = {}\n    for k, v in pairs(WeakAuras.clones[aura_env.id]) do\n        table.insert(t, v)\n        --for a, b in pairs(v.state) do print(a, b) end\n    end\n    table.sort(t, function(a,b) \n            return a.state.index < b.state.index\n    end)\n    for i, region in ipairs(t) do\n        if region.toShow then\n            if aura_env.config.barHiding then hideMove = 1000000000000 else hideMove = 0 end -- if user claims for hiding the progress bar just move them outside the screen\n            local column = perRow > 0 and count % perRow or count\n            local xOff = (region.width + spacing) * column + hideMove -- add move here for hiding bar tick\n            xOff = horzontal_growth == \"LEFT\" and 0-xOff or xOff\n            local row = perRow > 0 and math.floor(count / perRow) or 0\n            local yOff = - row * (region.height + spacing) \n            yOff = vertical_growth == \"UPWARD\" and 0-yOff or yOff\n            region:SetOffset(baseX + xOff, baseY + yOff)\n            \n            if region.state.name == \"野生小鬼\" then\n                region.bar:SetForegroundColor(aura_env.config.impColor[1], aura_env.config.impColor[2], aura_env.config.impColor[3], aura_env.config.impColor[4])\n            end\n            if region.state.name == \"恐惧猎犬\" or region.state.name == \"邪犬\" or region.state.name == \"恶魔卫士\" then\n                region.bar:SetForegroundColor(aura_env.config.dogColor[1], aura_env.config.dogColor[2], aura_env.config.dogColor[3], aura_env.config.dogColor[4])\n            end\n            if region.state.name == \"邪恶的地狱犬\" or region.state.name == \"乌祖尔\" or region.state.name == \"黑暗犬\" or region.state.name == \"愤怒卫士\" or region.state.name == \"古尔丹之眼\" or region.state.name == \"灾怨蝇\" or region.state.name == \"破坏魔\" or region.state.name == \"虚空恐魔\" or region.state.name == \"伊利达雷萨特\" or region.state.name == \"召唤玛克扎尔王子\"then\n                region.bar:SetForegroundColor(aura_env.config.portalDemonColor[1], aura_env.config.portalDemonColor[2], aura_env.config.portalDemonColor[3], aura_env.config.portalDemonColor[4])\n            end\n            if region.state.name == \"恶魔暴君\" then\n                region.bar:SetForegroundColor(aura_env.config.tyrantColor[1], aura_env.config.tyrantColor[2], aura_env.config.tyrantColor[3], aura_env.config.tyrantColor[4])\n            end\n            if region.state.name == \"恶魔传送门\" then\n                region.bar:SetForegroundColor(aura_env.config.portalColor[1], aura_env.config.portalColor[2], aura_env.config.portalColor[3], aura_env.config.portalColor[4])\n            end\n            if region.state.name == \"恶魔暴君cd\" then\n                region:SetOffset(baseX + xOff+500000000000000000, baseY + yOff)\n                -- move this progress bar outside the screen since it's not necessary to be visible to users\n            end\n            \n            if region.state.name ~= \"恶魔暴君cd\" then\n                count = count + 1\n            end\n        end\n    end\nend\n\n-- Created By: XYZ\n-- NGA ID:    xyz0101",
				},
